import React, { Component } from "react";
import axios from "axios"; 

import { FormGroup, Input, Label } from 'reactstrap';
import { Card, CardHeader, CardBody, CardTitle, Row, Col } from "reactstrap";
import FormInputs from "../../components/FormInputs/FormInputs.jsx";
import Button from "../../components/CustomButton/CustomButton.jsx";

class RegisterPage extends Component {
  constructor () {
    super()
    this.state = {
      nome: '',
      email: '',
      cpf: ''
    }
  }

  componentDidMount(){
    axios.get(`http://localhost:3001/oapi/paciente/`)
    // .then(response => this.setState({nome: response.data[0].nome} ))
    .then(response => console.log(response.data))
  }

  render(){
    return (
      <div className="content">
          <Col md={12} xs={12}>
            <Card className="card-user">
              <CardHeader>
                <CardTitle>Informações Básicas</CardTitle>
              </CardHeader>
              <CardBody>
                <form>
                  <Row>
                    <FormGroup className="col-md-6 col-md-6 px-1">
                        <Label>Nome</Label>
                        <Input 
                          type="text" 
                          placeholder="Nome" 
                          onChange={(event) => this.setState({nome: event.target.value})}
                        />
                        <Label>Email</Label>
                        <Input 
                          type="text" 
                          placeholder="Email" 
                          onChange={(event) => this.setState({email: event.target.value})}
                        />
                    </FormGroup>
                  </Row>
                  <Row>
                    <FormGroup className="col-md-6 col-md-6 px-1">
                        <Label>RG</Label>
                        <Input 
                          type="text" 
                          placeholder="RG" 
                        />
                        <Label>CPF</Label>
                        <Input 
                          type="text" 
                          placeholder="CPF" 
                          onChange={(event) => this.setState({cpf: event.target.value})}
                        />
                    </FormGroup>
                  </Row>
                  <Row>
                    <div className="update ml-auto mr-auto">
                      <Button color="success" round>Salvar</Button>
                    </div>
                  </Row>
                </form>
              </CardBody>
            </Card>
          </Col>
      </div>
    );
  }
}

export default RegisterPage;
